from core.big_number import BigNumber
import os
import sys
import unittest


if os.name == 'posix':
    sep = '/'
else:
    sep = '\\'
sys.path.append(os.getcwd().rsplit(sep,1)[0])


class FunctionTest(unittest.TestCase):

    def setUp(self) -> None:

        self.big_positive_number_1 = BigNumber(number="19884313212139312328923")
        self.big_positive_number_2 = BigNumber(number="2920193810920129831098230192830")

        self.result_sum_1 = "2920193830804443043237542521753"
        self.result_object_1 = BigNumber("2920193830804443043237542521753")

        self.big_positive_number_3 = BigNumber(number="10000000000000000000000000")
        self.big_positive_number_4 = BigNumber(number="90000000000000000000000000000000000000000000000000")

        self.result_sum_2 = "90000000000000000000000010000000000000000000000000"
        self.result_object_2 = BigNumber("90000000000000000000000010000000000000000000000000")

        self.small_positive_number_1 = BigNumber("73912873")
        self.small_positive_number_2 = BigNumber("831212")

        self.result_sum_3 = "74744085"
        self.result_object_3 = BigNumber("74744085")

        self.small_positive_number_3 = BigNumber("80201")
        self.small_positive_number_4 = BigNumber("932")

        self.result_sum_4 = "81133"
        self.result_object_4 = BigNumber("81133")

        self.very_big_positive_number_1 = BigNumber("123" * 100)
        self.very_big_positive_number_2 = BigNumber("256" * 101)
        self.result_sum_5 = ""
        self.result_object_5 = BigNumber("")

        self.very_big_positive_number_3 = BigNumber("1938" * 10000)
        self.very_big_positive_number_4 = BigNumber("256" * 10101)
        self.result_sum_6 = ""
        self.result_object_6 = BigNumber("")

        self.negative_number_1 = BigNumber("-1329320320")
        self.negative_number_2 = BigNumber("-372392729")

        self.positive_number_1 = BigNumber("123903123312")
        self.positive_number_2 = BigNumber("2312931231233123")

        self.wrong_char_number_1 = BigNumber("dq3282023ds")
        self.wrong_char_number_2 = BigNumber("dsajdl3228320das")

    def test_big_positive_numbers(self):

        self.assertEqual((self.big_positive_number_1 + self.big_positive_number_2).number, self.result_sum_1)
        self.assertEqual((self.big_positive_number_1 + self.big_positive_number_2), self.result_object_1)

        self.assertEqual((self.big_positive_number_3 + self.big_positive_number_4).number, self.result_sum_2)
        self.assertEqual((self.big_positive_number_3 + self.big_positive_number_4), self.result_object_2)

    def test_small_positive_numbers(self):

        self.assertEqual((self.small_positive_number_1 + self.small_positive_number_2).number, self.result_sum_3)
        self.assertEqual((self.small_positive_number_1 + self.small_positive_number_2), self.result_object_3)

        self.assertEqual((self.small_positive_number_3 + self.small_positive_number_4).number, self.result_sum_4)
        self.assertEqual((self.small_positive_number_3 + self.small_positive_number_4), self.result_object_4)

    def test_very_big_positive_numbers(self):

        self.assertEqual((self.very_big_positive_number_1 + self.very_big_positive_number_2).number, self.result_sum_5)
        self.assertEqual((self.very_big_positive_number_1 + self.very_big_positive_number_2), self.result_object_5)

        self.assertEqual((self.very_big_positive_number_3 + self.very_big_positive_number_4).number, self.result_sum_6)
        self.assertEqual((self.very_big_positive_number_3 + self.very_big_positive_number_4), self.result_object_6)

    def test_negative_numbers(self):
        with self.assertRaises(ValueError):
            self.negative_number_1 + self.negative_number_2

        with self.assertRaises(ValueError):
            self.negative_number_1 + self.positive_number_1

        with self.assertRaises(ValueError):
            self.negative_number_2 + self.positive_number_1

        with self.assertRaises(ValueError):
            self.negative_number_1 + self.positive_number_2

        with self.assertRaises(ValueError):
            self.negative_number_2 + self.positive_number_2

    def test_wrong_numbers(self):

        with self.assertRaises(ValueError):
            self.wrong_char_number_1 + self.wrong_char_number_2

        with self.assertRaises(ValueError):
            self.wrong_char_number_1 + self.positive_number_1

        with self.assertRaises(ValueError):
            self.wrong_char_number_2 + self.positive_number_1

        with self.assertRaises(ValueError):
            self.wrong_char_number_1 + self.positive_number_2

        with self.assertRaises(ValueError):
            self.wrong_char_number_2 + self.positive_number_2


if __name__ == '__main__':
    unittest.main()